  'HR Portal': 'ðŸ‘¥', // People icon for HR
  'DevOps Portal': 'âš™ï¸', // Gear icon for DevOps
  'Finance Portal': 'ðŸ’°', // Money bag icon for Finance
  'default': 'ðŸ“±' // Default icon for other apps
};

export const getAppIcon = (appName) => {
  // Find the matching icon or return default
  const icon = Object.entries(appIcons).find(([key]) => 
    appName.toLowerCase().includes(key.toLowerCase())
  );
  return icon ? icon[1] : appIcons.default;
};

export default appIcons;
